import React, { useState, useEffect, Component } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import mapStyle from '../../maps/mapStyle.json';
import axios from 'axios';
import NavBar from '../../components/NavBar'
import newMark from './marker.svg'

const MapContainer = (props) => {
  var icon = {
    url: './marker.svg', // url
    scaledSize: new props.google.maps.Size(100, 100), // scaled size
    origin: new props.google.maps.Point(0,0), // origin
    anchor: new props.google.maps.Point(0, 0) // anchor
};

var marker = new props.google.maps.Marker({
    map: props.map,
    icon: icon
});
  const [markers, setMarkers] = useState([])
  useEffect(() => {
    axios.get('https://iron-cors-anywhere.herokuapp.com/https://maps.googleapis.com/maps/api/place/nearbysearch/json?location=25.76439676537,-80.20731679740429&radius=1500&type=restaurant&key=AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M')
      .then((response) => {
        //setLocations(response.data.results);
        setMarkers(response.data.results.map(place => {
          let icon = {
            url: marker.icon,
            size: new props.google.maps.Size(71, 71),
            origin: new props.google.maps.Point(0, 0),
            anchor: new props.google.maps.Point(17, 34),
            scaledSize: new props.google.maps.Size(25, 25)
          };
        
          return <Marker className="marker" key={place.place_id} title={place.name} style={mapStyle} icon={icon} name={place.name} position={place.geometry.location} />
        }))
      })
  }, []);

  return (
    <div className="map-container">
    <NavBar/>
    
    <Map
      className='Map'
      google={props.google}
      zoom={14.25}
      draggableCursor='default'
      styles={mapStyle}
      disableDefaultUI={true}
      zoomControl={false}
      scaleControl={false}
      rotateControl={false}
      gestureHandling="none"
      initialCenter={
        {//25.766917437599158, -80.19897262209749
          lat: 25.767917437599158,
          lng: -80.220000000000
        }
      }
    >
      
      {markers}

    </Map>
    </div>
  );

}

export default GoogleApiWrapper({
    apiKey: 'AIzaSyBibnOWEr72nhfg0dEPgv5Amv09pXcRk_M',
})(MapContainer);
